import React from 'react';
import axios from 'axios';

const User = (users: any[]) => (
    <div>
      <ul>
        {users[0]}
      </ul>
    </div>
)

User.getInitialProps = async () => {
  const response = await axios.get(
    'http://localhost:3333/users'
  );

  return { users: response.data };
}

export default User;
